    were used for payments to Pringle Communications.   No employee worked over 25%
    of their time on any activity in connection with a Federal Election during the
    period of August Monthly, September Monthly and October Monthly reports.  Payments
    on Schedule H4 Line 21(a) for 'Telephones' did not refer to any candidate for
    federal office.  The transfers to the Committee's Non-Federal Account reported
    on Schedule B for Line 29 as ''Transfers to Non-Federal Account' to the 'Democratic
    Party of Virginia' were for cash flow purposes and no allocable expenses were
    paid from this Non-Federal Account. Payments for 'General Consulting,' 'Website
    Consulting,' and 'Legal Fees' were made for non-employee compensation. Payments
    for 'General Consulting' were for general political advising.  Disbursements for
    'Cell Phone Reimbursement' were stipends for cell phone expenses and are paid
    to the individuals on a predetermined scale.  These payments are not reimbursements
    for a specific payment to a vendor. Two reimbursement itemizations for Schedule
    H4 have been provided.  However, given that the Coordinated Campaign is temporary,
    the rest of the physical files are in the process of being moved to a new location.  The
    Committee will file amendments to itemize the reimbursements on Schedule H4 when
